import { Avatar } from '@mui/material';
import React from 'react'


const Navbar = () => {
  return (
    <header>
        <nav>
           <h1>Welcome</h1> 
           <div className="avatar">
            <Avatar>M</Avatar>
           </div>
        </nav>
    </header>
  )
}

export default Navbar;
